import React from 'react'
import { TextField, Paper } from '@material-ui/core'

function StoryField() {
    return (
        <Paper style={{ textAlign: "center", margin: "0 auto", width: "40%", height: "50vh", background: "linear-gradient(to right, #e8cbc0, #636fa4)" }}>
            <TextField label="Title" style={{ width: "52%" }}></TextField>
            <TextField multiline variant="outlined" style={{ width: "70%" }} rows="10"></TextField>
        </Paper>

    )
}

export default StoryField
